import { Component } from '@angular/core';
import { Route } from '@angular/router';
import { ProductEntity } from 'src/app/interface/productEntity';

@Component({
  selector: 'app-nav-bar',
  templateUrl: './nav-bar.component.html',
  styleUrls: ['./nav-bar.component.css']
})

export class NavBarComponent {

  constructor(private _router: Route  ) {}

  aBuscar= "";
  ImagenLogo =  "../../../../assets/images/Convertic.JPG";
  welcomeImagenPath = "";
  respuestaBusqueda: ProductEntity[] = [];

  oneKeyup(){
    console.log(this.aBuscar);
  }

  toCart(){
    this._router.navigate(['Tienda/home']); 
  }
}
